import './css/SearchBarComponent.css';
import React from 'react';

export class SearchBarComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            guess_val: ""
        }
    }

    blurVal() {
        document.getElementsById('search').value = "";
    }

    render() {
        return (
            <div>
            <div class="box">
                <form name="search">
                    <input type="text" id='search' class="input" name="txt" onmouseout={this.blurVal()} />
                </form>
                <i class="fas fa-search">Search here</i>
            </div>
            </div>
        )
    }

}
